import React from "react";

function ExpenseItem() {
  return (
    <div>
      <div>2 Nov 2021</div>
      <div>
        <h2>Car insurance</h2>
        <div>$294.67</div>
      </div>
    </div>
  );
}

export default ExpenseItem;
